import React from "react";
import ReactDom from "react-dom";
import "./index.css";

const title = "Title";
const author = "Author";
const img = "https://m.media-amazon.com/images/I/61JSKZ6vHQS._AC_UY218_.jpg";

function BookList() {
  return (
    <section className="booklist">
      <Book img={img} title={title} author={author} />
    </section>
  );
}

const namesList = [{ name: "Nume 1" }, { name: "Nume 2" }, { name: "Nume 3" }];

function List() {
  return namesList.map((item) => {
    return <p>{item.name}</p>;
  });
}

const Book = (props) => {
  return (
    <article className="book">
      <img src={img} />
      <h1>{title}</h1>
      <h4>{author}</h4>
      <p></p>
      <List />
    </article>
  );
};

ReactDom.render(<BookList />, document.getElementById("root"));
